import React from 'react'
import Navbar from '../components/widgets/Navbar';
import '../App.css'

const designTiles={
    width: '40%',
    height: 'auto'
}

class Miscellaneous extends React.Component{
    render(){
        return(
            <div className='MainPage'>
                <Navbar />
                <div>
                    <div>
                        MISCELLANEOUS
                    </div>
                    <div className='pageStyles'>
                        Random graphic designs projects I've worked on :)
                        <div>
                            <img src={require('../components/images/misc/Gazette.jpg')} alt='Gazette' style={designTiles}/>
                            <img src={require('../components/images/misc/Gazette.jpg')} alt='Gazette' />
                        </div>
                        <div>

                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Miscellaneous;
